properties.script:
[
    {"type":"narrate", "data":[
	["<i>(sound of parent)</i>", []],
	["<%name%> heard a familiar sound and headed downstairs.", []]
]}
]

[
    {"type":"narrate", "data":[
	["In the playroom were two of <%name%>'s most bestest friends: <%friend1%> and <%friend2%>", []]
]}
]

[
    {"type":"narrate", "data":[
	["As <%name%> entered the kitchen, they were greeting by their parents.", []],
	["<i>(parents' greetings)</i>", []]
]}
]

[
    {"type":"narrate", "data":[
	["As time passed, <%name%> grew and soon they didn't need walking to school. They were grown up.", []],
	["<%name%>'s parents were upset of course", []],
	["<i>crying</i>", []]
]}
]

[
    {"type":"narrate", "data":[
	["Like always, there was a message left on the board when <%name%> entered.", []]]
}
]

[
{"type":"narrate", "data":[
    ["And like always, <%name%> left their own message for whoever would enter next.", []]]
},
    {"type": "image", "key": "blackboard", "title": "Blackboard message", "instruction": "Leave a message on the blackboard", "width": 64, "height": 64, "background": true},
    {"type": "modifyTilesheet", "data": [
                        ["/s/assets/blackboard-empty.png", 7, 21],
	["<#blackboard#>", 7, 21]
                    ]}
]

[
    {"type":"narrate", "data":[
	["This is an important part, the school dance. This is where it all happens.", []],
	["But that's not right. <%name%> hated that haircut. I'm sure they changed it right before the dance.", []]
]},
    {"type": "image", "key": "hair", "title": "Haircut", "instruction": "Finally <%name%> gets to choose their own hair style. Give them something cool.", "width": 55, "height": 42, "guide": "/s/assets/guides/hair-guide.png"},
    {"type": "useOwnHair"},
{"type":"narrate", "data":[
	["That's more like it. <%name%> continued into the sports hall.", []]
]}
]

[
    {"type":"narrate", "data":[
	["And it was there, between the basketball hoops, that <%name%> met their soulmate.", []],
	["As the music stopped, and the track changed to something unforgettable, their eyes met.", []],
	["<i>Unforgettable music</i>", []],
	["And then, they touched.", []]
]}
]
